import React from 'react';
import ReactPaginate from "react-paginate";

const Pagination = () => {
  return (
    <ReactPaginate
      breakLabel="..."
      nextLabel="next >"
      onPageChange={e => console.log(e)}
      pageRangeDisplayed={8}
      pageCount={3}
      previousLabel="< previous"
      renderOnZeroPageCount={null}
    />
  );
};

export default Pagination;
